import React from 'react';
import './marker.css';
class CustomMarker extends React.Component {

    constructor(props) {
        super(props);
    }
    render() {
        let green_blue = 0;
        let frequency = this.props.frequency;
        console.log(this.props);
        if(frequency <= 9) {
            green_blue = 256 - frequency*26;                //1-230   2-204   3-179   4-153  
        }
        return (
            <div className="marker"
            style={{ backgroundColor: `rgb(255,${green_blue}, ${green_blue})`, cursor: 'pointer'}}
        />)
    }
}

export default CustomMarker;
